import React from "react";
import { Routes } from "react-router-dom";
import "./App.css";
import Header from "./component/Header";
import Post from "./component/Post";

const App = () => {
  return (
    <Routes>
      <main>
        <Header />
        <Post />
        <Post />
        <Post />
      </main>
    </Routes>
  );
};

export default App;
